const isAuthorise = userData => userFetchedData => console.log("userdata", userData, "fetchdata", userFetchedData);

function isNotArchived(archivedIds) {
    return function (story) {
        return archivedIds.indexOf(story.objectID) === -1;
    };
}

const isUserExists = (state) => {
    return (
        isNotArchived(state.loginState.userData)
    );
}

const getFetchError = ({ storyState }) => {
    return (
        storyState.error
    );
}

export { isUserExists, getFetchError }
